import React, { Component } from 'react';
import NavBar from './NavBar.js';
import Blurb from './Blurb.js';
import classNames from 'classnames';
import './App.css';
import Tachyonsocialfooter from './Tachyonsocialfooter.js'
import { Container, Row, Col } from 'reactstrap';
import WorkCards from './WorkCards.js';
import Carousel from './Carousel.js';
import AOS from 'aos'; //Animation library import and CSS
import 'aos/dist/aos.css';
import FadedHeader from './FadedHeader.js'
import Portrait from './Portrait.js';
import Anchor from './Anchor.js';
import Languages from './Languages.js';
import AnimatedCollapsible from './AnimatedCollapsible.js';


class App extends Component {

  componentDidMount(){
    AOS.init({
      duration : 1800,
    })
  }


  render() {

    return (
      <div className={classNames("App", this.state)}>
       <NavBar/>

        <div className="App-body">

          <div style={{minHeight:"3em"}}></div>

          <FadedHeader title="My First Impression" side="right" fade="left"></FadedHeader>

          <Container id="App-body">
            <Row className="padded-top">
              <Col>
                <div data-aos="zoom-in-up"><Portrait></Portrait></div>
              </Col>
              <Col data-aos="zoom-in-up">
                <h1><AnimatedCollapsible text={'Scott Lau Stubbs'}></AnimatedCollapsible></h1> <br/>
                <h2> Hey There. As I am sure you have gathered by now, my name is Scott.</h2>
                <h2> This site serves as a landing page for you to learn a little bit about who I am more in depth than your typical resume does.</h2>
                <h2> And (let's be honest) it is a nice way to flex some of my react muscles. </h2>
              </Col>
            </Row>
          </Container>

          <div style={{minHeight:"3em"}}></div>

          <FadedHeader title="Languages" side="left" fade="right"></FadedHeader>

          <Container id="Languages">
            <Row className="padded-top">
              <Languages/>

            </Row>
          </Container>
            <br />
          <div style={{minHeight:"3em"}}></div>

          <FadedHeader title="Academics" side="right" fade="left"></FadedHeader>
          <Container id="Academics">
            <Row className="padded-top">
              <Carousel></Carousel> {/* Moved data-aos to component*/}
            </Row>
          </Container>
            <br />
          <div style={{minHeight:"3em"}}></div>

          <FadedHeader title="Work Experience" side="left" fade="right"></FadedHeader>
          <br />
          <Container id="Jobs">
            <Row className="padded-top">
              <Col>
                <WorkCards></WorkCards> {/* Moved data-aos to component*/}
              </Col>
            </Row>
          </Container>
            <br /><br />

          <FadedHeader title="Projects" side="right" fade="left"></FadedHeader>
            <br />
          <Container id="Projects">
            <Row className="padded-top">
              <h2>Projects will go here. Coming soon! <br /> In the meantime you can
              <Anchor name="find them here." url="https://github.com/mrscottstubbs"/></h2>
            </Row>
          </Container>

          <div style={{minHeight:"3em"}}></div>

        </div>

        <Blurb />

        <div id="bottom"> <hr/>
          <Tachyonsocialfooter></Tachyonsocialfooter>
        </div>

      </div>
    );
  }
}

export default App;
